import React from 'react';
import ReactDOM from 'react-dom';
import { Provider } from 'react-redux';
import store from "./State/store";
import App from './App';
import './index.css'
ReactDOM.render(
<Provider store={store}> 
<App/>, 
document.getElementById('root')
</Provider>  
);
